import React from 'react';
import '/home/rguktongole/Desktop/ideanexus/frontend/src/styles/UserDashboard.css'; // Import the dashboard CSS

const Dashboard = () => {
    return (
        <div className="dashboard-container">
            <div className="dashboard-header">
                <div className="profile-logo">
                    {/* You can add a profile image or text here */}
                    <span>P</span>
                </div>
                <input type="text" className="search-bar" placeholder="Search..." />
                <div className="message-icon">
                    {/* Use an icon for message here */}
                    <span>M</span>
                </div>
            </div>

            <div className="dashboard-content">
                {/* Posts and user profiles content */}
            </div>
        </div>
    );
};

export default Dashboard;
